import React from 'react'
import { Helmet } from 'react-helmet-async';
import { ToastContainer } from 'react-toastify';
import Footer from './Footer';
import Nav from './Nav';
import Sidebar from './Sidebar';

export const NewCategory = () => {
  return (
    <div>
      <ToastContainer />
      <Helmet>
        <title>Categories</title>
      </Helmet>
      <Nav />
      <Sidebar />
      

      <Footer />
    </div>
  );
}
